/*
	1. The hooks is added to change the vendor response to empty body 
    when it fails with 'Page Not Found' (error code 400) error
    while paginating.
    2. It also add elements-total-count header if the call is successful.
    The hook executes only for GET all APIs. 
 */

var method = request_method;
var path = request_path;
var resp_code = response_status_code;
var body = response_body;
var headers = response_headers;

var respBody = JSON.stringify(body);
var index1 = respBody.indexOf('@TotalResources');
var index2 = respBody.indexOf('@TotalPages');

//check for GET id API
if (method === 'GET' && index1 === -1) {
	// This is a GET /id API or it is in error
	if(response_iserror && resp_code === 400) {
		resp_code = 200;
		body = [];
		done({
			"response_body": body,
			"response_status_code": resp_code
		});
	} else {
		done();
	}
}

if (method === 'GET' && index1 > -1) {
		var respBody = JSON.stringify(body);
		var index1 = respBody.indexOf('@TotalResources');
		var index2 = respBody.indexOf('@TotalPages');
		var totalString = '@TotalResources';
		var count = respBody.substring(index1 + totalString.length + 2, index2 - 2);
		headers['elements-total-count'] = count;
		done({
			"response_headers": headers
		});	
}

done();
